import React from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import {Helmet} from 'react-helmet';
import {Home} from './pages/Home';

function App() {
  return (
    <BrowserRouter>
    <div className='App'>
    <Helmet>
    <title>Home</title>
    </Helmet>
    <Routes>
      <Route path="/" element={<Home />}></Route>
    </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
